import React from 'react'

const Nav = () => {
    return (
        <div className='fixed bg-gray-800 text-white rounded-2xl right-0 p-1 px-2 m-3'>
            <svg class="w-6 h-full" fill="none" stroke="currentColor" viewBox="0 0 24 24" xmlns="http://www.w3.org/2000/svg"><path stroke-linecap="round" stroke-linejoin="round" stroke-width="2.5" d="M4 4h18M4 14h18M4 18h18"></path></svg>
        </div>
    )
}

export default Nav


